            <Route path="/" exact component={<VideoPlayer
                handleFormSubmit={handleSubmit}
                handleVideoDetails={handleVideoDetails}
                handleVideoSelect={handleVideoSelect}
                video={selectedVideo}
                videos={videos}
                details={details}
